ルームライトに9個、マップライトに各3個ずつ6000kのLEDが配置された、SMDタイプの一体型LEDライトユニットです。<br><br>純正カーテシーライト本体とそのまま交換して使用します。6000ｋなので寒色系ホワイトに発光します。<br><br>本商品は、フロント用です。<BR><BR>車種によっては警告灯が点灯する場合があります。その際は別途ダミーロード等をご用意ください<BR><BR>対応車種 ：2005～　ゴルフプラス<br><br>車検対応品<br><br>ランプ、レンズ | LED<tr><td colspan="2">
