18個(左右あわせると合計36個）の白色LEDバルブのカーテシーライト。フットライト、ミラーライト、グローブBOX、トランクライトなどをLEDでを鮮やかに照らします。純正のランプユニットを取り外し、商品と交換するだけと、作業もとても簡単。キャンセラー内蔵で球切れ警告灯の誤作動を防止します。 <br><br>ウェッジ球のみLEDに交換しても、発光にムラができ一部しか照らさなかったり純正時よりも暗くなってしまうといった問題が生じますが、ユニット交換タイプはレンズ面からナンバーに向かって直接照射するようにLEDが配置されており明るさ、発光範囲ともに段違いです。<br><br>●2個セット　●キャンセラー内臓　●専用ハーネス付属　　※BMW品番　63 31 6 972 605/63 31 6 961 999/63 31 6 902 911/63 31 6 962 009/ <br><br>対応車種：BMW E63/64 6シリーズ <br><br>車検対応品<br><br>ランプ、レンズ/LED<tr><td colspan="2">
